import logo from "../assets/logo.png"
const AdminLayout = () => {
  return (
    <div>
      {/* navbar */}
        <div className='w-screen h-16 bg-gradient-to-r from-purple-800 to-pink-400 shadow-md shadow-black flex relative'>
            <div style={{ backgroundImage: `url(${logo})` }} className='w-12 h-full bg-cover bg-center text-black bg-black z-50'>

            </div>
        </div>
    </div>
  )
}

export default AdminLayout
